// src/config/api.config.js
import axios from 'axios';

export const backend_API = process.env.REACT_APP_API_URL || 'http://localhost:5000';

export const apiClient = axios.create({
  baseURL: backend_API,
  headers: {
    'Content-Type': 'application/json',
  },
});
